2391162224961193802";}i:196;a:1:{s:10:"short_code";s:11:"CEvHV_rJQdK";}i:197;a:1:{s:12:"created_time";i:1599268771;}i:198;a:1:{s:7:"caption";s:2138:"Posted @withregram • @kishlb Sept. 4, 1875: #ClintonMississippi #Massacre

Time Periods: Reconstruction Period: 1865 - 1876

Themes: African American, #Reconstruction, #Democracy & #Citizenship, #Racism & #RacialIdentity

The #Reconstructionera #ClintonMassacre began on Sept. 4, 1875, in the small town of #ClintonMississippi at a #Republican rally to introduce the party’s candidates who were running for political office in the upcoming #Novemberelections. The immediate death toll included five African American and three white men. Over the next several days, an estimated #fifty African Americans were killed.
Over 1,500 #blackRepublicans and their families gathered on the grounds of the former #MossHillplantation for a barbecue and #politicalrally. Approximately 100 whites also attended, including a few #Democrats from the nearby town of Raymond.

While a Republican was giving a speech, shots were fired. When the gunfire ended, a total of five African Americans, including two children, and three white people were dead, and nearly thirty others were wounded.
The following days were marked by violence and bloodshed as the white mob indiscriminately shot and killed nearly fifty African Americans in Clinton and the surrounding area. In addition, the white mob murdered a white school teacher working in the African American community.
Although Governor Ames requested federal troops to assist in restoring order, President #UlyssesGrant denied the request on September 14 and adopted a policy of non-intervention, leaving Ames and the local Black and white Republicans without protection.
Description above from Blackpast.org by Sheren Sanders, #AlcornStateUniversity.
Learn more from the detailed account in #ClintonRiotof1875: From #Riot to Massacre (Mississippi Historical Society). The article includes testimonies from the time and recent efforts by the town to recognize and teach about the history. Also, see Clinton Massacre Leaves More Than 20 Blacks Dead in #Mississippi (Equal Justice Initiative.)
Teach about the #Reconstruction era and the long history of the struggle for #votingrights.";}i:199;a:1:{s:14:"comments_count";i:0;}i:200;a:1:{s:11:"likes_count";i:3;}i:201;a:1:{s:4:"link";s:39:"https://www.instagram.com/p/CEvHV_rJQdK";}i:202;a:1:{s:5:"image";s:238:"https://scontent-sin6-2.cdninstagram.com/v/t51.2885-15/e35/118713310_122546109316802_4127084686396697548_n.jpg?_nc_ht=scontent-sin6-2.cdninstagram.com&_nc_cat=102&_nc_ohc=GOPcStbs9_gAX8dBEW1&oh=43e394d97ec55011b2e372e4ff618c1c&oe=5F7C6CF0";}i:203;a:1:{s:4:"type";s:5:"image";}i:204;a:1:{s:8:"owner_id";i:7828750511;}i:205;a:1:{s:14:"owner_username";s:0:"";}i:206;a:1:{s:14:"owner_fullname";s:0:"";}i:207;a:1:{s:9:"owner_pic";s:0:"";}i:208;a:1:{s:2:"id";s:19:"2391162067563331822";}i:209;a:1:{s:10:"short_code";s:11:"CEvHTtFgEDu";}i:210;a:1:{s:12:"created_time";i:1599268752;}i:211;a:1:{s:7:"caption";s:747:"Words can inspire, thoughts can provoke, but only action truly brings you closer to your dreams

